import React from 'react'
import './contact.css'

const Contact = () => {
  return (
    <section className="contact container section" id="contact">
      <h2 className="section__title">Get In Touch</h2>
      <span className="section__subtitle">Contact Me</span>

    </section>
  )
}

export default Contact
